import React from "react";
import "./Home.css";
function Home() {
  return (
    <div className="head">
      <button className="button">Login</button>
      <button className="button">Signup</button>
      <br />
      <body className="body">
        On 15 April 1952, the three battalions serving with the Parachute
        Brigade were removed from their respective Infantry Regiments to form
        the Parachute Regiment. Since then the Parachute Regiment has grown to
        comprise ten battalions including Parachute (Special Forces) battalions.
        In 1986, 8 PARA became 12 Battalion, Mechanised Infantry Regiment, while
        21 Maratha LI converted to PARA (Special Forces). During their short but
        eventful existence so far, the regiment's battalions have had extensive
        operational experience, and singular achievements, to speak of their
        level of professionalism.
      </body>
    </div>
  );
}

export default Home;
